import './main.css';
import React from 'react'
import {  BrowserRouter ,  Routes, Route } from "react-router-dom";
import Home from './page/home' 

function App() {
  return (
    <div className="App">
          <BrowserRouter>
             <Routes>
                 <Route path="/" element={<Home />} />
            </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
